"   <div class=\"cntnt\" style=\"width: 492px; height: 381px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Schematic drawing demonstrating the close relationship of the pelvic viscera (bladder, vagina, urethra, and rectum) to bony structures of the pelvis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Sagi C. Lower extremity: Pelvic ring fractures. In: Rockwood and Green's Fractures in Adults, 7th ed, Bucholz RW, Court-Brown CM, Heckman JD, Tornetta P (Eds), Lippincott Williams &amp; Wilkins, Philadelphia 2010. Copyright &copy; 2010 Lippincott Williams &amp; Wilkins.",
"    </div>",
