var title_f21_35_22074="Lymphomatoid papulosis histology";
var content_f21_35_22074=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=DERM%2F82763%7EDERM%2F82764&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F82763%7EDERM%2F82764&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 525px\">",
"   <div class=\"ttl\">",
"    Histopathology of lymphomatoid papulosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 505px; height: 341px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) Early perivascular lesion.",
"    <br/>",
"    (B) Neutrophils within and around blood vessels are characteristic.",
"    <br/>",
"    (C) Mature wedge-shaped lesion.",
"    <br/>",
"    (D) Advanced ulcerated lesion.",
"    <br/>",
"    Early lesions have a perivascular lymphoid infiltrate. Mature lesions have a wedge-shaped appearance. The most common type A lesions have large Reed-Sternberg-like cells and frequent mitoses in an inflammatory background. Type B lesions resemble mycosis fungoides (MF) and may be a papular variant of MF. Type C lesions demonstrate a relatively monotonous population of large CD30+ cells with few inflammatory cells.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Panel C reproduced from: Kadin ME. Primary cutaneous CD30-positive t-cell lymphoproliferative disorders. In: Hematopathology, Jaffe ES, Harris NL, Vardiman JW, et al. (Eds), Philadelphia, Elsevier 2011. Illustration used with the permission of Elsevier Inc. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 533px\">",
"   <div class=\"ttl\">",
"    Wedge-shaped infiltrate of lymphomatoid papulosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 513px; height: 195px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    CD30 immunostaining.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
