"       </td>",
"       <td class=\"subtitle1\">",
"        Target of detection",
"       </td>",
"       <td class=\"subtitle1\">",
"        Approximate time to positivity (days)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Enzyme-linked immunoassay",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        First generation",
"       </td>",
"       <td class=\"centered\">",
"        IgG antibody",
"       </td>",
"       <td class=\"centered\">",
"        35 to 45",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Second generation",
"       </td>",
"       <td class=\"centered\">",
"        IgG antibody",
"       </td>",
"       <td class=\"centered\">",
"        25 to 35",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Third generation",
"       </td>",
"       <td class=\"centered\">",
"        IgM and IgG antibody",
"       </td>",
"       <td class=\"centered\">",
"        20 to 30",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Fourth generation",
"       </td>",
"       <td class=\"centered\">",
"        IgM and IgG antibody and p24 antigen",
"       </td>",
"       <td class=\"centered\">",
"        15 to 20",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Western blot",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        &nbsp;",
"       </td>",
"       <td class=\"centered\" rowspan=\"2\">",
"        IgM and IgG antibody",
"       </td>",
"       <td class=\"centered\">",
"        35 to 50 (indeterminate)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\">",
"        45 to 60 (positive)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        HIV viral load test",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Sensitivity cut-off 50 copies/mL",
"       </td>",
"       <td class=\"centered\">",
"        RNA",
"       </td>",
"       <td class=\"centered\">",
"        10 to 15",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Ultrasensitive cut-off 1 to 5 copies/mL",
"       </td>",
"       <td class=\"centered\">",
"        RNA",
"       </td>",
"       <td class=\"centered\">",
"        5",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    This table demonstrates the approximate time to positivity following infection for various diagnostic tests for HIV.",
